measurements.description:
Approximately 340 flowers and 50 buds on 10 pendent up to 20cm inflorescences, plus one juvenile inflorescence;
sepals lanceolate, reflexed against ovary, green;
 petals ovate, green basally, yellow centrally and distally, heavily fimbriate;
  lip tri-lobed, side lobes clubbed, green distally, yellow basally, midlobe fimbriate, white shading to green basally;
  substance delicate; texture waxy, raised bumps on petals.
